B.zv=new A.bq("1","Arabica","Arabica is the most popular type of coffee, hands down. Depending on who you ask, many coffee enthusiasts prefer using Arabica beans due to its taste. Typically used for black coffee, Arabica beans have a sweeter, more complex flavor that you can drink straight. Funny thing is, even though it\u2019s the most popular, it doesn\u2019t have as much caffeine as Robusta.","https://images.pexels.com/photos/5472417/pexels-photo-5472417.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
